import React from 'react';
import { Field, reduxForm } from 'redux-form';

class StreamCreate extends React.Component {

    renderInput({ input }) {
        console.log(input)
        return (
            <div className="field">
            <h1>{input.name}</h1>
            <label>
                <input {...input} />
            </label>
            </div>
        )
    }

    render(){
        return (
            <form>
                <Field name="title" component={this.renderInput} label="Eeter Title" />
                <Field name="description" component={this.renderInput} label="Enter Description" />
            </form>
        )
    }
}

export default reduxForm({
    form: 'streamCreate'
})(StreamCreate);
